export default function Item({ item, toggleItem }) {
	// onChange={() => onToggleItem(item.id)}
	return (
		<li>
			<input
				type="checkbox"
				value={item.bought}
				onChange={() => toggleItem(item.id)}
			/>
			<span style={item.bought ? { textDecoration: 'line-through' } : {}}>
				{item.item}
			</span>
		</li>
	)
}
